import React from 'react';
import groupImage from '../images/Group.png';

const ContactUs = () => {
  return (
    <div className="container mx-auto flex flex-col md:flex-row items-center justify-between py-10">
      {/* Image */}
      <div className="md:mr-10 mb-6 md:mb-0 lg:w-1/2">
        <img src={groupImage} alt="Group" className="rounded-lg" />
      </div>
      {/* Contact Form */}
      <div className="flex flex-col md:w-1/2 gap-y-10">
  <h1 className="text-left mb-4 text-4xl">Make your room feel homey</h1>
  <div className="flex items-center border rounded-full overflow-hidden">
    <input
      type="email"
      placeholder="Insert your email address"
      className="rounded-full py-2 px-4 w-full border border-[#FADCD9] focus:outline-none focus:border-blue-500"
    />
    <button className="px-4 bg-[#FADCD9]">
      <svg width="8" height="14" viewBox="0 0 8 14" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M1 0.999999L7 7L1 13" stroke="#F79489" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" />
      </svg>
    </button>
  </div>
</div>

    </div>
  );
};

export default ContactUs;
